import React, { useEffect } from "react";

export const Detail_Image_Section = (props) => {

    const Hello = () => {
        console.log('hello')
    }

    const photo_dispenser = (input) => {

        switch(typeof input){
            case('object'):
            console.log(input[0].getUrl())
            return <div
                    id='timer'
                    style={{
                        display: 'flex',
                        flexDirection: 'row',
                        justifyContent:'start',
                        width:'55vw',
                        overflow: 'scroll',
                        aspectRatio: '1'
                    }}
                    
                    >

                        {input.map((element)=>{
                        return <img
                        style={{
                            width:'55vw',
                            objectFit: 'cover'
                            }}
                        src={element.getUrl()}
                        >
                        </img>
                        })}

                </div>

            case('undefined'):
            return;
        }

    }

    useEffect(()=>{
        let target= document.getElementById('timer')

        const timer = setInterval(() => {
            target.addEventListener("scroll", Hello);
          }, 3000);
          return () => {
            clearInterval(timer);
            window.removeEventListener("scroll", Hello);
          };
    })

    return <React.Fragment>

    {photo_dispenser(props.photos)}

    </React.Fragment>

}

export default Detail_Image_Section
